import React from "react";
import {Container, Row, Col} from 'react-bootstrap';
import './CSS/Footer.css';
import Logos from "./Images/Logos.png";

function Footer() {
    return (
        <>

        <Container className="c footer" fluid>
    <Row className="c">
    <Col className="c" sm={4}>
    <img src={Logos} width="100" height="100" alt="logo"/>

    </Col>

    <Col className="c info_col" sm={8}>
        <Row className="c r1">
    <Col className="c footer_options" sm={2}>Home</Col>
    <Col className="c footer_options" sm={2}>Search</Col>
    <Col className="c footer_options" sm={2}>Stories</Col>
    <Col className="c footer_options" sm={2}>Contact Us</Col>
        </Row>
        <Row className="c icons">
        <div className="icon_spacing"></div>
        <div className="icon_spacing"></div>
        <div className="icon_spacing"></div>
        <div className="icon_spacing"></div>
        </Row>
    </Col>
  </Row>
        </Container>

        </>
    );
}
export default Footer;
